const postData = async (url, data) => {
  const res = await fetch( url , {
    method: 'POST',
    mode: 'no-cors',
    headers: { 'Accept': 'application/json', 'Content-Type': 'application/raw' },
    body: { "user": "Juan",
    "comment": "sheikah",
    "idRestaurant": "60f648108969227b792ad404"}
  })
  return res.json();
}

export default postData;
